window.bookSummaryJSON = "<p>From number one&nbsp;best-selling author Brandon Sanderson and Janci Patterson comes the first of three Skyward series novellas, each told from the perspective of a different member of the team back on Detritus. Listen to FM's story between <i>Starsight</i> and <i>Cytonic</i>.</p> <p>When a planet-destroying Delver suddenly appears in the sky of Detritus and vanishes just as suddenly, FM knows that the last free human society got lucky. Her Skyward Flight companion, Spensa, figured out how to draw this Delver away, but it won’t be so easy next time.</p> <p>The forces of the Galactic Superiority will be back - and if the Defiant Defense Force can’t figure out a way to escape the planet, humanity’s destruction is only a matter of time. Spensa’s mission to infiltrate the Superiority unveiled the secret to their hyperdrives - a cytonic slug species called the Taynix. Now FM’s flightleader, Jorgen, has found a large group of Taynix hiding in the caverns far below Detritus’s surface.</p> <p>FM and Jorgen must work together with the engineer Rig to awaken the mysterious alien Alanik and unlock the powers of the Taynix, or humanity will be trapped.&nbsp;With Spensa’s friend Minister Cuna of the&nbsp;Superiority&nbsp;stranded at the outpost of Sunreach, they need to figure out how to rescue&nbsp;them - or the Superiority government will be in the sole clutches of those who want to wipe out Detritus once and for all.</p> <p>Praise for <i>Skyward</i></p> <p>An Instant <i>New York Times</i> Best Seller&nbsp;&nbsp;&nbsp;</p> <p>A <i>Kirkus Reviews</i> Best Book of the Year</p>"; 
